import React from 'react';
import "../css/HelloWorld.css"


const obj = () =>(

    <div>
        <h1 className='helloWorld'><text className="hello">Hello</text> World!</h1> 
        <img className='goDown' src="../../down_arrows.png" />
    </div>
)

function HelloWorld({ scrollDown }) {
    return (
        <div id="HelloWorldCont">


            <h1 className='helloWorld'><text className="hello">Hello</text> World!</h1> 
            <img className='goDown' src="../../down_arrows.png" onClick={scrollDown}/>
        </div>
    );
  }

export default HelloWorld;
